const docs = {
    getAllDocs: async function getAllDocs() {
        let a = `${URL}/docs`;
        console.log("helo world");
        console.log("url is "+ a);
        const response = await fetch(`${URI}/docs`); // Hämtar allt som ligger bakom url/docs
        // const response = await fetch("http://localhost:1337/docs");//Fetch ger sträng

        const result = await response.json(); // Gör om sträng till json

        console.log(result);
        console.log(result.data);

        // return result.data;
        return result;
    },
};

export default docs;
